import { Category } from "../types";

interface Props {
  categories: Category[];
  onDeleteCategory: (id: number) => void;
}

const CategoryList = ({ categories, onDeleteCategory }: Props) => (
  <ul>
    {categories.map(cat => (
      <li key={cat.id} style={{ marginBottom: 8 }}>
        {cat.name}
        <button onClick={() => onDeleteCategory(cat.id)} style={{ marginLeft: 8 }}>Sil</button>
      </li>
    ))}
  </ul>
);

export default CategoryList;
